const App=()=>{

    let count=0;

    const IncNum=()=>{
        console.log("clicked " + count++)
    }

    return (
        <>
            <h1>{count}</h1>
            <button onClick={IncNum}>Click Me</button>
        </>
    )
}
export default App;
